description:
Borzo (ex WeFast; https://borzodelivery.com/in) is the business delivery you can trust — fast intracity courier delivery service. Borzo provides package deliveries on a bike or mini-trucks across Mumbai, Delhi, Bangalore, Hyderabad, Chennai and other cities. 
Download Borzo and place an order in seconds.

Key offerings include:
- By End of Day: 40% cheaper than on-demand delivery;
- Truck delivery: bulk deliveries and multi-stop shipments for cargos up to 1,000 kg;
- Deliver Now: immediate pickup and dropoff within 1 hour;
- Scheduled delivery: planned deliveries arrive at the doorstep right on time.

Delivery with BORZO courier service:
- Order delivery in a couple of clicks via plain forms on the user-friendly app and website;
- Thousands of top-rated polite couriers;
- Professional courier tracking: track orders on the map and see the estimated delivery time;
- Safety: insurance with declared value up to ₹50 000;
- The fast delivery service: the most efficient delivery route is automatically built by the app;
- We find a courier in 2 minutes;
- Our customer support service is available 24/7 via the in-app chat.


BORZO knows how to help any type of business or store:
- E-shop items & e-com express;
- Documents (delivered in a document file folder);
- Clothes, shoes and lifestyle stores;
- Food, groceries and many more supermarket items;
- Flowers, gifts and cake delivery;
- Pharma goods;
- Restaurants (with and without a food delivery app);
- any other business.

We offer you different payment methods:
- Pay by cash;
- Card-to-card transfer;
- Borzo credit balance or wallet.
The price is calculated online right in the app.


Support. Customer service representatives can help you with order status, advise on the best delivery type, explain how our service works and why we have the best couriers.
If you have any questions or comments about our service, drop us a note:

- India: support.client.in@borzodelivery.com
- Brazil: support.client.br@borzodelivery.com
- Mexico: support.client.mx@borzodelivery.com


Choose Borzo for a smarter, hassle-free logistics experience. Borzo helps you save money. You can send several parcels with a single courier on a freight transport. We always show the price of delivery before you create an order — that way you can keep track of your finances.

If you want to become a delivery rider, check out our courier app: Borzo Delivery Partner.
